import React, { useEffect, useState, useRef } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';

const flaskURL = 'http://localhost:5001';

function EditorPage() {
  const { filename } = useParams();
  const [originalURL, setOriginalURL] = useState('');
  const [editedURL, setEditedURL] = useState(null);
  const [isDrawing, setIsDrawing] = useState(false);
  const [startPoint, setStartPoint] = useState(null);
  const [selection, setSelection] = useState(null);
  const [loading, setLoading] = useState(false);

  const imgRef = useRef(null);
  const overlayRef = useRef(null);

  useEffect(() => {
    setOriginalURL(`${flaskURL}/uploads/${filename}`);
  }, [filename]);

  const handleRemoveBG = async () => {
    setLoading(true);
    try {
      const res = await axios.post(
        `${flaskURL}/remove-bg`,
        { filename },
        { responseType: 'blob' }
      );
      const blob = new Blob([res.data], { type: 'image/png' });
      setEditedURL(URL.createObjectURL(blob));
    } catch (err) {
      alert("Background removal failed.");
    }
    setLoading(false);
  };

  const handleRemoveObject = async () => {
    if (!selection) {
      alert('Please select an object area.');
      return;
    }

    setLoading(true);
    try {
      const res = await axios.post(`${flaskURL}/remove-object`, {
        filename,
        x: Math.round(selection.x),
        y: Math.round(selection.y),
        w: Math.round(selection.w),
        h: Math.round(selection.h)
      }, { responseType: 'blob' });

      const blob = new Blob([res.data], { type: 'image/png' });
      setEditedURL(URL.createObjectURL(blob));
    } catch (err) {
      console.error('Error removing object:', err);
      alert('Object removal failed.');
    }
    setLoading(false);
  };

  const handleDownload = () => {
    const link = document.createElement('a');

    if (editedURL) {
      link.href = editedURL;
      link.download = `edited-${filename}`;
    } else {
      link.href = `${flaskURL}/download/${filename}`;
      link.download = filename;
    }

    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  };

  const handleMouseDown = (e) => {
    const rect = overlayRef.current.getBoundingClientRect();
    setIsDrawing(true);
    setStartPoint({
      x: e.clientX - rect.left,
      y: e.clientY - rect.top
    });
  };

  const handleMouseMove = (e) => {
    if (!isDrawing || !startPoint) return;
    const rect = overlayRef.current.getBoundingClientRect();
    const endX = e.clientX - rect.left;
    const endY = e.clientY - rect.top;
    setSelection({
      x: startPoint.x,
      y: startPoint.y,
      w: endX - startPoint.x,
      h: endY - startPoint.y
    });
  };

  const handleMouseUp = () => {
    setIsDrawing(false);
  };

  return (
    <div style={{ padding: '2rem' }}>
      <h2>🎨 Editing: {filename}</h2>
      <div
        style={{ position: 'relative', display: 'inline-block' }}
        ref={overlayRef}
        onMouseDown={handleMouseDown}
        onMouseMove={handleMouseMove}
        onMouseUp={handleMouseUp}
      >
        <img
          src={originalURL}
          alt="Original"
          ref={imgRef}
          style={{ width: '300px', display: 'block' }}
        />
        {selection && (
          <div
            style={{
              position: 'absolute',
              border: '2px dashed red',
              left: `${selection.x}px`,
              top: `${selection.y}px`,
              width: `${selection.w}px`,
              height: `${selection.h}px`,
              pointerEvents: 'none'
            }}
          />
        )}
      </div>

      {editedURL && (
        <img
          src={editedURL}
          alt="edited"
          style={{ width: '300px', marginLeft: '2rem' }}
        />
      )}

      <br />
      <button onClick={handleRemoveBG} disabled={loading} style={{ marginTop: '1rem' }}>
        {loading ? "Removing..." : "Remove Background"}
      </button>

      <button
        onClick={handleRemoveObject}
        disabled={!selection || loading}
        style={{ marginLeft: '1rem' }}
      >
        {loading ? "Removing..." : "Remove Object"}
      </button>

      <button onClick={handleDownload} style={{ marginLeft: '1rem' }}>
        Download
      </button>
    </div>
  );
}

export default EditorPage;
